import React from "react"
import ReactDOM from "react-dom"
import TodoItem from "./TodoItem";

function Checklist() {
    return (
        <div>
            <TodoItem taskName="Degree"/>
            <TodoItem taskName="Job"/>
            <TodoItem taskName="Place"/>
        </div>
    )
}

export default Checklist

ReactDOM.render(<Checklist />, document.getElementById("ohyeah"))
